import React from "react";
import Slider from "react-slick";

function Home() {
  const settings = {
    dots: true,
    infinite: true,
    speed: 500,
    slidesToShow: 1,
    slidesToScroll: 1,
  };

  return (
    <Slider {...settings}>
      <div>
        <img
          src="https://www.wallpapertip.com/wmimgs/66-666819_website-design-background-creative-background-image-for-website.jpg"
          alt="Image 1"
        />
      </div>
      <div>
        <img
          src="https://wallpaperbat.com/img/215835-wallpaper-design-website.jpg"
          alt="Image 2"
        />
      </div>
      <div>
        <img src="image3.jpg" alt="Image 3" />
      </div>
    </Slider>
  );

