  //       <h1>Hi Welcome to the designer section</h1>
  //     </div>
  //     <img
  //       src="https://wallpaperbat.com/img/215835-wallpaper-design-website.jpg"
  //       alt="Home_background"
  //       className="h-2/3 w-screen"
  //     ></img>
  //   </div>
  // </div>
}

export default Home;
